import React from "react";
import "../products/Products.css";


function Products({id, name, cost, quantity, url}) {
  const dispatch = useDispatch();


  return (
    <div>
      <div className="row">
        <div className="product">
          <div className="card-body">
            <div className="immg">
              <img
                src={url}
                className="img"
                alt="#"
              ></img>
            </div>
            <h5>{name}</h5>
          </div>
          <div className="price">
            <h3>{cost}</h3>
          </div>
          <button className="basket_btn">Добавить в корзину</button>
        </div>

      </div>
    </div>
  );
}

export default Products;
